import React, { useEffect, useState } from 'react';
import { getCalendar } from '../apiHandlers/calendarapi';

function CreateCalendar() {
  const [calendar, setCalendar] = useState(new Date());

  return (
    <div>
      <h2> { setCalendar } </h2>
    </div>
  );
}

export default CreateCalendar;
